// RIP AOTS

var util = require('util'),
    sleep = require('sleep'),
    exec = require('child_process').exec,
    child;
var parseString = require('xml2js').parseString;

var video_list = [];

var all_video_numbers = {};

var i = 0;
var max = video_list.length;
//var max = 61835;

function fetchPage(i){
    var child = exec('curl -d \'videoKey='+i+'&strPlaylist=&playLargeVideo=true&excludedVideoKeys=&playlistType=nor&maxPlaylistSize=1&cb=1942531\' http://www.g4tv.com/xml/BroadbandPlayerService.asmx/GetEmbeddedVideo',
    function (error, stdout, stderr) {
      parseString(stdout, function(err, result){

        try{
          //Extract the value from the data element
          var el = result["BroadbandPlayer"]["EmbeddedVideos"][0]["Video"][0];
          //console.log(JSON.stringify(el));
          var key = el["$"]["Key"] + "";
          //console.log(key);
          //console.log(el["FilePath"][0]);
          var path = el["FilePath"][0].split("vids.g4tv.com")[1];
          //console.log(path.replace(/\%2f/g, "/"));
          path = "http://vids.g4tv.com" + path.replace(/\%2f/g, "/");
          //console.log("FilePath: "+path);
          filename = path.split("/");
          filename = key+"_"+filename[filename.length-1];
          //console.log("FileName: "+filename);
          //console.log("Title: " + el['Title']);

          all_video_numbers[key] = {
            path : path,
            title : el["Title"]
          };

          
          console.log("curl -o "+filename+" "+path);
          console.log("# "+JSON.stringify({key : { path : path, title : el["Title"] }}));

        }catch(err){

        }

        sleep.sleep(1);
        nextPage();

      })
  });
}

function nextPage(){
  i++;
  if(i>max){
    //console.log( all_video_numbers );

    // var ret_arr = [];
    // for(key in all_video_numbers){
    //   ret_arr.push(key);
    // }

    console.log("\n\n\n")
    console.log(JSON.stringify(all_video_numbers));

    return;
  } 
  else fetchPage(video_list[i]);
}

nextPage();


